import React from "react";
import { Stack } from "@mui/material";
import { categories } from "../utils/constans";
const SlideBar = () => {
  return (
    <Stack
      direction="row"
      sx={{
        overflowY: "auto",
        height: { sx: "auto", md: "95%" },
        flexDirection: { md: "column" },
      }}
    >
      SlideBar
    </Stack>
  );
};

export default SlideBar;
